// Manipulation of data
struct Matrix* cmatrix_encode(struct Matrix * word, struct Matrix_config * conf)
{
    return matrix_mul(conf->GENERATOR_MATRIX, word);
}

struct Matrix* cmatrix_decode(struct Matrix * word, struct Matrix_config * conf)
{
    struct Matrix* corr_word = cmatrix_correction(word, conf);
    struct Matrix* result = cmatrix_extract(word, conf);
    matrix_free(corr_word);

    return result;
}

// --------------- //
struct Matrix* cmatrix_extract(struct Matrix * word, struct Matrix_config * conf)
{
    struct Matrix* word_decode = matrix_generate(K, 1);

    for(uint16_t i = 1; i <= (uint16_t)(K); i++)
        matrix_set(word_decode, i, 1, matrix_get(word, i, 1));

    return word_decode;
}
struct Matrix* cmatrix_correction(struct Matrix * word, struct Matrix_config * conf)
{
    struct Matrix* syndrome = cmatrix_syndrome(word, conf);
    struct Matrix* word_correct = matrix_copy(word);
    uint8_t* erroneous_bits;
    uint8_t erroneous_bit;
    if(!matrix_is_null(syndrome))
    {
        erroneous_bits = cmatrix_get_erroneous_bits(syndrome);

        for(uint8_t i = 0; i < (uint8_t)(SIZE_SYNDROME_ARRAY); i++)
        {
            #ifndef __AVR__
                erroneous_bit = *(erroneous_bits + i);
            #else
                erroneous_bit = pgm_read_byte((erroneous_bits + i));
            #endif

            if(erroneous_bit != 0)
                matrix_set(word_correct, erroneous_bit, 1, OPPOSITE_BIT(matrix_get(word, erroneous_bit, 1)));
        }

        free(erroneous_bits);
        return word_correct;
    }

    matrix_free(syndrome);
    return word_correct;
}

uint8_t* cmatrix_get_erroneous_bits(struct Matrix* synd)
{
    uint16_t syndrome = matrix_word_to_int(synd);
    uint8_t synd_array[SIZE_SYNDROME_ARRAY];

    #ifndef __AVR__
        return SYNDROME_ARRAY[syndrome];
    #else
        return pgm_read_byte(&SYNDROME_ARRAY[syndrome]);
    #endif
}
